import React, { useState } from "react";

const Content = () => {
	const [name, setName] = useState("Dave");
	const handleNameChange = () => {
		const names = ["Bob", "Julie", "Thomas", "Mathias"];
		const int = Math.floor(Math.random() * 3);
		return names[int];
	};

	const handleClick = (name) => {
		console.log(`${name} was clicked`);
	};
	const handleClickev = (e) => {
		console.log(e);
	};

	return (
		<div>
			<main>
				<p>Hello {name}</p>
				<button onClick={() => handleClick("ismail")}>Click it</button>
				<button onClick={(e) => handleClickev(e)}>Click it</button>
			</main>
		</div>
	);
};

export default Content;
